import React from 'react';


const Profile = ({ users }) => {
    users.map(user => {
      return (
        <div key={user.id}>
          <p>{user.name}</p>
          <p>{user.surname}</p>
          <p>{user.gender}</p>
          <p>{user.region}</p>
        </div>
      )
    })
}


class List extends React.Component {

  render() {
    const { data } = this.props;
    return (
      <div>
        {data.map((user, id) =>
          <div key={id}>{user.name}</div>
        )
        }
      </div>
    )
  }
}
export default Profile;
